import React, { useState } from 'react';
import PasswordStrengthBar from 'react-password-strength-bar';
import { ReactTyped } from 'react-typed';
import './SignUp.css';

function SignUp() {
  const [currentStep, setCurrentStep] = useState(0);
  const [fullName, setFullName] = useState('');
  const [email, setEmail] = useState('');
  const [mobileNumber, setMobileNumber] = useState('');
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');
  const [username, setUsername] = useState('');
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');
  const [showInput, setShowInput] = useState(false);

  const steps = [
    { label: 'Enter your email*', type: 'email', value: email, setter: setEmail },
    { label: 'Create a password*', type: 'password', value: password, setter: setPassword },
    { label: 'Confirm Password*', type: 'password', value: confirmPassword, setter: setConfirmPassword },
    { label: 'Full Name*', type: 'text', value: fullName, setter: setFullName },
    { label: 'Mobile Number*', type: 'tel', value: mobileNumber, setter: setMobileNumber },
    { label: 'Enter a Username*', type: 'text', value: username, setter: setUsername },
  ];

  const handleNext = () => {
    // Validation logic
    const validators = [
      (value) => value || setError('Email is required.'),
      (value) => value || setError('Password is required.'),
      () => password === confirmPassword || setError('Passwords do not match.'),
      (value) => value || setError('Full Name is required.'),
      (value) => value || setError('Mobile number is required.'),
      (value) => value || setError('Username is required.'),
    ];

    if (!validators[currentStep](steps[currentStep].value)) {
      return;
    }

    setError('');
    setCurrentStep((prevStep) => prevStep + 1);
  };

  const handleSubmit = async () => {
    const userData = { fullName, email, mobileNumber, username, password };
    try {
      const response = await fetch('http://localhost:5000/api/register', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(userData),
      });

      if (!response.ok) {
        const errorData = await response.json();
        setError(errorData.message || 'Registration failed.');
        return;
      }

      const data = await response.json();
      setSuccess(data.message);
    } catch {
      setError('An error occurred during registration.');
    }
  };

  return (
    <div className="signup-container">
      {!showInput ? (
        <h1>
          <ReactTyped
            strings={["Welcome to MyndAI!", "Let’s begin the adventure"]}
            typeSpeed={50}
            backSpeed={30}
            loop={false}
            onComplete={() => setShowInput(true)}
          />
        </h1>
      ) : (
        <div className="signup-form-container">
          <form className="signup-form" onSubmit={(e) => e.preventDefault()}>
            {steps.map((step, index) => (
              index === currentStep && (
                <div key={index}>
                  <label>{step.label}</label>
                  <div className="input-group">
                    <input
                      type={step.type}
                      value={step.value}
                      onChange={(e) => step.setter(e.target.value)}
                      required
                    />
                    {currentStep < steps.length - 1 && (
                      <button
                        type="button"
                        className="signup-button"
                        onClick={handleNext}
                      >
                        Continue
                      </button>
                    )}
                  </div>
                </div>
              )
            ))}
            {error && <p className="error-message">{error}</p>}
            {success && <p className="success-message">{success}</p>}
            {currentStep === steps.length - 1 && (
              <div className="signup-form-button-container">
                <button type="button" className="signup-button" onClick={handleSubmit}>
                  Register
                </button>
              </div>
            )}
          </form>
          {currentStep === 1 && (
            <div className="password-strength-container">
              <PasswordStrengthBar password={password} />
            </div>
          )}
        </div>
      )}
    </div>
  );
}

export default SignUp;
